INSERT INTO `app_018_help` VALUES (1,'تفقد خطي e1 في المقسم','  من خلال الرابط التالي\nhttp://192.168.30.161'),(2,'تنصيب maria db 11.3','  \n$sudo vim /etc/yum.repos.d/mariadb.repo\nadd these lines\n---------------------\n[mariadb]\nname = MariaDB\nbaseurl = http://yum.mariadb.org/11.3/rhel8-amd64\nmodule_hotfixes=1\ngpgkey=https://yum.mariadb.org/RPM-GPG-KEY-MariaDB\ngpgcheck=1\n----------------------------\n$sudo dnf update\n$sudo dnf install mariadb-server\n$sudo systemctl start mariadb\n$sudo systemctl enable mariadb'),(3,'python code to create bridge net adps','import subprocess\nsubprocess.run([\"sudo\", \"sysctl\", \"-w\", \"net.ipv4.ip_forward=1\"])\nsubprocess.run([\"sudo\", \"iptables\", \"-F\"])\n\ninput1_interface = \"ens34\"\ninput2_interface = \"ens35\"\noutput_interface = \"ens36\"\n\nlocal_network1 = \"192.168.40.240/24\" \nlocal_network2 = \"192.168.50.240/24\" \n\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-A\", \"FORWARD\", \"-i\", input_interface1, \"-s\", local_network1,\n    \"-o\", output_interface, \"-j\", \"ACCEPT\"])\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-A\", \"FORWARD\", \"-i\", output_interface, \"-o\", input_interface1,\n    \"-m\", \"state\", \"--state\", \"ESTABLISHED,RELATED\", \"-j\", \"ACCEPT\"])\n\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-t\", \"nat\", \"-A\", \"POSTROUTING\", \"-o\", output_interface, \"-j\", \"MASQUERADE\"])\n\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-A\", \"FORWARD\", \"-i\", input_interface2, \"-s\", local_network2,\n    \"-o\", output_interface, \"-j\", \"ACCEPT\"])\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-A\", \"FORWARD\", \"-i\", output_interface, \"-o\", input_interface2,\n    \"-m\", \"state\", \"--state\", \"ESTABLISHED,RELATED\", \"-j\", \"ACCEPT\"])\n\nsubprocess.run([\n    \"sudo\", \"iptables\", \"-t\", \"nat\", \"-A\", \"POSTROUTING\", \"-o\", output_interface, \"-j\", \"MASQUERADE\"])\n\n\nsubprocess.run([\"sudo\", \"iptables-save\"])\n'),(4,'تصحيح مشاكل اللغة العربية في mariadb','  ALTER TABLE \"tablename\" CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;'),(6,'طلب بينغ من جهاز بعيد','  sshpass -p \'YourPassword\' ssh user@hostname \'ping -c 4 google.com\'\n'),(10,'استبدال تونر الطابعة','1- افتح غطاء المحبرة\n2-اضغط ok بشكل مستمر قليلا\n3- اضغط *00 \n4- اضغط ok\n5- أغلق الغطاء '),(11,'V-Center Mazeh','يتم عن طريق تشغيل \nopenvpn 185.134.132.88\nhttp://192.168.108.111\n'),(12,'تنظيف iptables','sudo iptables -t nat -F\nsudo iptables -t mangle -F\nsudo iptables -t raw -F\nsudo iptables -t security -F\nsudo iptables -F\nsudo iptables -X\n'),(13,'V-Center Adawie','http://192.168.30.103'),(14,'Access points','Call center\nTcc7\nhttp://192.168.60.7\nMgmt only by port lan1 :\nUser: tcc7\nPass: root@tcc7\nWifi filterd on mac _no password\n SSID : TCC7\n______________________\n'),(15,'التحقق من المزامنة بين الدومين كونترولرز','من خلال قراءة الاشعار على قناة التلغرام الذي يرسل بشكل يومي وهو يشير الى انه تمت المزامنة اليومية '),(16,'مخدم الكيرو.... تسجيل خروج+مساحة القرص','أ - التاكد من المساحة المتاحة على قرص التخرين\nوافراغها في حال الامتلاء بعد الاحتفاظ بنسخة احتياطية\n\nب - انهاء جلسات المستخدمين\n\n1- http://192.168.50.251:4080/admin\n2- status\n3- active host\n4- right click _ logout all users'),(17,'حذف ملفات الصلاحيات القديمة','C:\\Windows\\System32\\GroupPolicy\nshow hidden files\ndelete all\nrestart'),(20,'تسجيلات المقسم التلقائية','التاكد من ان المقسم يقوم بعملية تسجيل المكالمات بشكل تلقائي\nوذلك من خلال قراءة الاشعار على قناة التلغرام التي تعطي تنبيه بانه تم انشاء مجلد تسجيلات بتاريخ اليوم والتاكد من المساحة المتبقية على قرص التسجيلات '),(22,'التذكير','اعادة تحويل الاشعار الخاص بالتذكير من قناة التلغرام الخاصة الى مجموعة مكتب التشغيل ملاحظات\n');
